const SignIn: React.FC = () => {
	return (
		<div>
			<div>SIGN IN</div>
			<div>To continue the order, please sign in</div>
			<input
				placeholder="Email adress"
				type={'text'}
			/>
			<input
				placeholder="Password"
				type={'number'}
			/>
			<button>LOGIN</button>
		</div>
	);
};
export default SignIn;
